import { useState } from "react";
import toast from "react-hot-toast";
import axios from "../../utils/axios";
import PublicLayout from "../../components/layout/PublicLayout";

/* ---------------- S3 UPLOAD ---------------- */
const uploadToS3 = async (file, folder) => {
  const { data } = await axios.get(
    `/s3/presigned-url?fileType=${encodeURIComponent(
      file.type
    )}&folder=${encodeURIComponent(folder)}`
  );

  const res = await fetch(data.uploadUrl, {
    method: "PUT",
    body: file,
  });

  if (!res.ok) throw new Error("Upload failed");
  return data.fileUrl;
};

export default function ModelRegister() {
  const [loading, setLoading] = useState(false);

  const [form, setForm] = useState({
    stageName: "",
    age: "",
    gender: "Female",
    email: "",
    phone: "",
    city: "",
    nationality: "",
    tagline: "",
    profileType: "",
    services: [],
    placeOfService: [],
    heightCm: "",
    weightKg: "",
    cupSize: "",
    bodyType: "",
    ethnicity: "",
    hairColor: "",
    eyeColor: "",
    pubicHair: "",
    rates: {},
    availableDays: [],
    availabilityText: "",
    website: "",
    snapchat: "",
    preferredContact: "",
    aboutMe: "",
    languages: "",
  });

  const [profileImage, setProfileImage] = useState(null);
  const [gallery, setGallery] = useState([]);

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;

    if (type === "checkbox") {
      setForm((p) => {
        const arr = p[name] || [];
        return {
          ...p,
          [name]: checked ? [...arr, value] : arr.filter((v) => v !== value),
        };
      });
    } else {
      setForm((p) => ({ ...p, [name]: value }));
    }
  };

  const submit = async (e) => {
    e.preventDefault();
    try {
      setLoading(true);

      const profileImageUrl = profileImage
        ? await uploadToS3(profileImage, "models/profile")
        : "";

      const galleryUrls = [];
      for (const img of gallery) {
        galleryUrls.push({
          url: await uploadToS3(img, "models/portfolio"),
        });
      }

      const payload = {
        ...form,
        languages: form.languages
          ? form.languages.split(",").map((l) => l.trim())
          : [],
        profileImage: profileImageUrl ? { url: profileImageUrl } : null,
        portfolio: galleryUrls,
      };

      await axios.post("/models/register", payload);

      toast.success("Profile submitted for review");
    } catch (err) {
      toast.error(err.response?.data?.message || "Submission failed");
    } finally {
      setLoading(false);
    }
  };

  return (
    <PublicLayout>
      <main className="single-profile">
        <section className="sp-title-bar">
          <div className="sp-inner">
            <h1 className="sp-main-title">Model Registration</h1>
            <p className="sp-subline">
              Submit your details to create a verified profile
            </p>
          </div>
        </section>

        <section className="sp-details">
          <div className="sp-inner">
            <form className="reg-form" onSubmit={submit}>
              {/* PROFILE HEADER */}
              <div className="sp-card reg-card">
                <h2>Profile Header</h2>
                <input
                  name="stageName"
                  placeholder="Display name"
                  required
                  onChange={handleChange}
                />
                <input
                  name="age"
                  type="number"
                  min="18"
                  placeholder="Age"
                  required
                  onChange={handleChange}
                />
                <input
                  name="tagline"
                  placeholder="Tagline"
                  onChange={handleChange}
                />
                <input
                  name="city"
                  placeholder="City / Area"
                  onChange={handleChange}
                />
                <input
                  name="nationality"
                  placeholder="Nationality"
                  onChange={handleChange}
                />
              </div>

              {/* SERVICES */}
              <div className="sp-card reg-card">
                <h2>Services</h2>
                {["GFE", "OWO", "Massage", "Couples", "Threesome"].map((s) => (
                  <label key={s}>
                    <input
                      type="checkbox"
                      name="services"
                      value={s}
                      onChange={handleChange}
                    />{" "}
                    {s}
                  </label>
                ))}
              </div>

              {/* AVAILABILITY */}
              <div className="sp-card reg-card">
                <h2>Availability</h2>
                {["Mon", "Tue", "Wed", "Thu", "Fri", "Sat", "Sun"].map((d) => (
                  <label key={d}>
                    <input
                      type="checkbox"
                      name="availableDays"
                      value={d}
                      onChange={handleChange}
                    />{" "}
                    {d}
                  </label>
                ))}
                <input
                  name="availabilityText"
                  placeholder="Typical hours"
                  onChange={handleChange}
                />
              </div>

              {/* ABOUT */}
              <div className="sp-card reg-card">
                <h2>About Me</h2>
                <textarea name="aboutMe" rows="5" onChange={handleChange} />
              </div>

              {/* MEDIA */}
              <div className="sp-card reg-card">
                <h2>Photos</h2>
                <input
                  type="file"
                  accept="image/*"
                  onChange={(e) => setProfileImage(e.target.files[0])}
                />
                <input
                  type="file"
                  accept="image/*"
                  multiple
                  onChange={(e) => setGallery(Array.from(e.target.files))}
                />
              </div>

              <button className="reg-submit-btn" disabled={loading}>
                {loading ? "Submitting..." : "Submit Profile"}
              </button>
            </form>
          </div>
        </section>
      </main>
    </PublicLayout>
  );
}
